// The MainPage component with navigation
const MainPage = () => {
  const navigate = useNavigate();

  const handleVisualizerClick = () => {
    navigate('/visualizer');  // Navigate to the visualizer page
  };

  return (
    <div className="mainpage">
      <h1>Welcome to the Algorithm Visualizer</h1>
      <button onClick={handleVisualizerClick}>Go to Visualizer</button>
      <AnimatedBackground /> {/* Including the animated background here */}
    </div>
  );
};

